 Nagar, 1st Cross, Karur - 639001,Tamil Nadu.  INDIA.\r\r\rSeeking a Senior Management assignment as\rMarketing /Quality Assurance /Fabric Sourcing/Product Development/MerchandiserHome Textile Products-Karur operation\rTarget Sector: Home Furnishing Textile & Made - Ups\r\rA quality conscious, innovative professional and qualified Textile Technologist with over 29 years extensive experience in sourcing, costing, procurement, processing, production and quality assurance of cotton woven textiles, home furnishings & made ups for export.\rExcellent knowledge of the availability of fabrics, accessories, handicrafts and reliable, technically sound sources of supply; strong expertise in evaluating costs, negotiating cost effective terms and conditions with vendors and ensuring the quality of material and different manufacturing process.\rPossesses in depth experience of designs in woven,dyeing, printed, embroidered and applique work in home textiles,Table Linen, bed & bath textiles, kitchen Textiles, window & floor covering; determined abilities in planning and monitoring production activities to ensure quality standards and delivery commitments and leading the design of new products using a wide variety of fabrics / natural fibres to conform to current usage trends and fashions.\rFunctions as a window between buyers and suppliers utilising excellent communication, persuasiveness, decision making and entrepreneurship capabilities to forge alliances and effective business relationships; maintains firm bonds with buyers and selects, guides and develops suppliers to improve their performance.\rAssit in the newly set up of the Buying Office SOUTH INDIA (KARUR) Operation for Home Textiles Division.\rOver see the daily operation of a buying office covering Sourcing ,Merchandising, Quality(AQL International Standard In line , Mid Line, Final Inspection)Shipping, Logistics and Administration functions.\r\rAREAS OF EXPERTISE\r\rSOURCING & PROCUREMENT /MARKETING\rInteract with buyers to fully understand their requirements and source suitable suppliers of home furnishing textiles and made-ups items based on their technical and commercial capability.\rEvaluate the detailed quality requirements of each order, work out fabric costing and negotiate with the vendors for prices and other terms and conditions.\rPlace orders for the material required and follow up for processing, finishing and delivery (including dyeing and printing).  \r\rPRODUCTION CONTROL & MONITORING\rPrepare samples of the finished product and submit the same for approval and feedback from the buyer, maintain full details of the approved samples. \rFormulate and review production schedules based on orders, delivery schedules and material / machine availability; organise resources and logistic arrangements accordingly. \rPrepare daily reports; communicate schedules to all the departments to facilitate coordination and smooth operations.\rEnsure strict adherence to approved fabric quality, colour and all other product parameters.\rConduct stringent online inspection of in manufacturing process material and monitor the fabric stitching, accessories, wash care labels and finishing.\rConduct quality checks on finished products to ensure correct quality in all respects.\rSupervise the final packing and marking to ensure adherence to the buyers requirements, handover the consignment along with necessary documentation to forwarding agents for shipment within agreed schedules.\r\rPRODUCT DEVELOPMENT / DESIGN\rMonitor international markets to stay in touch with current trends and products.\rDevelop new products and innovative designs of home textiles, cotton home furnishing items and handicraft items.\rDesign mats, blinds and curtains using eco friendly and attractive material including screw pine (palm leaf), bamboo, grass & straw and banana fibre.\rPrepare samples of newly designed products and make them available to buyers along with full details of the costing, materials used and advantages.\r\r\r\r\r\r\r\rQUALITY ASSURANCE\r-Colour Matching in Yarn Stage& Bit loom stage,do colour fastness at 40degree wet &dry rubbing &staining on cotton myself.\r-Sample development send &get feed back from the buyer.Geting Production Samples in time\r-Order follow ups, day to day reporting will be sent order status.\r-InLine Inspection, Mid Line Inspection, Final Inspection will be done .\r-Inspection will be done as per AQL International Standard\r-maintain the quality&delivery time&QC REPORT,Create new designs&develope new products.\r\r\rPRODUCT EXPERIENCE\r\rTable LinenTable cloths in Square,Rectangle,Oval, Round, Napkins, Table mat, Table Runner, Rib mat, Straw mat, Grass mat, Stick mat, Bamboo mat, Fushed mat, Palm tree fibre mat\rBed Linen &SOFA COVERS\rFitted sheet, Flat sheet,Bed Spread, Duvet cover, Pillow cover, Cushion cover (with tassel, zip, button), Freel, Quilt, Chair pad, Mattress, Cushion futon (filled with cotton or polyfibre) Throws, CHAIR COVER, SINGLE SEAT COVER, 3SEAT COVERBath LinenSower curtains,BathTerry Towels in Plain Colour,  Jacquard, Barmops, Monocheck,Stripes, Hand Towel, Beach Towel.Wall HangingsCurtains in yarn dyed voile / cotton organdy with embroidery / appliqu work,  Lace / Shower Curtains,Seersucker curtains, Leno curtains, Printed organdie / Patchwork curtains(with loops or buttons), Roman blinds with rolling type curtains / natural or dyed bamboo sticks, Straw Kitchen SetsKitchen aprons & gloves, Pot holders, Kitchen towel, Waffle towel, Double glove, Jacquard towel, Printed towel, Fruit basket,Dish cloth,Kitchen &Floor Cleaning Cloth,HandicraftsNatural finish and dyed Palm tree leaf products (napkin boxes / wine bottle bags / trays / tea mat / bread basket / hand bags), Straw beach mat, Bamboo curtain \rFabricsBed Covers (solid colours / stripes / checks /dobby/ jacquard designs), Printed bed covers with embroidery work, Bed covers with fee cotting (hole stitching) / border stitching / lace stitching), Leno, Double cloth ribbed fabricFloor Covering Mats\r\rBath Mat,Rag  Rugs in Plain Colour, stripe, check, multi\r                                                    PROFESSIONAL EXPERIENCE\r\r\rSURAAJ LINENS PVT LTD,MUMBAI. \r\rManager Merchandioser/ Fabric Sourcing / Quality Assurance / Production / Marketing (AUGUST 2013 to2017JUNE)\r\rA well established Buying House cum Exporter of cotton textile home furnishing & made-ups items. The company was established in 1990 and employs around 50 persons. \r\rReporting to the Buyer (Home Furnishing Textiles & Made  Ups) leading a team of 10 and responsible for the entire process of coordinating with the foreign buyer for orders / sample approvals etc., product development, procurement of material for re work & finishing, managing the production and quality control, packing and ensuring despatch according to set delivery schedules.\r\rKey Accomplishments\rMaintained effective relationship with customers and provided quality goods packed by excellent service resulting in substantial referral orders and enhanced customer loyalty.\rSourced and purchased a very wide variety of material at highly competitive rates.\rDeveloped vendors to drastically improve the quality of their material, thereby enhancing the quality of the finished products as well.\rUtilised in depth and varied knowledge of designs and fabrics to guide and introduce new concepts to foreign buyers.\rDeveloped a range of handicraft items conductive to foreign lifestyles and cultures which proved very popular.\r\r\r\r\r\r\r\r\r\r\rPREVIOUS EXPERIENCE (INDIA)\r\rCOMPANYLOCATIONDESIGNATIONPERIODSURAAJ LINENS PVT LTD,MumbaiWork at \rKARURGeneral Manager-Marketing/Fabric Sourcing /Quality Assurance Manager - Home Furnishing Textiles & Made - UpsAugust16 -2013 to\r June 2017TEXTILE PEOPLE(Buying House)\rMUMBAIWORK AT\rKARURGeneral Manager/Marketing/Fabric Sourcing /Quality Assurance Manager - Home Furnishing Textiles & Made - UpsJANUARY 2009 TO 2013ju